import './css/footer.css';



export const Footer = () => {
  return (
    <div>
        <footer>
            <div className="footer">
              <h4>@SAGAR SHARMA</h4>
              <p>1st Floor, <br />Gopalan Millennium Tower, <br /></p>
            </div>
        </footer>




    </div>
  )
}

export default Footer
